import React from 'react';
import CardList from './CardsArray';
import {robots} from './robots';
import {SearchBox} from './SearchBox';


const App = () => { 
	return (
		<div>
		<h1> My Robo Website </h1>
		<SearchBox />
		<CardList robots={robots} />
		</div>
		);
}
export default App;
